-module(search_funcs).

-export([get_search_list/1,
  compare/2,
  search_test/2,
  output_debug/2,
  output_debug/3,
  output_info/2,
  output_info/3]).

-record(item, {value}).

% 1: DEBUG
% 2: INFO
% 3: WARN
% 4: ERROR
% 5: FATAL
-define(LOG_LEVEL, 2).

%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
% public function
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
get_search_list(3) ->
  [
    #item{value=3} ,
    #item{value=2} ,
    #item{value=1}
  ];
get_search_list(N) ->
  get_search_list([], N).
get_search_list(L, 0) ->
  L;
get_search_list(L, N) ->
  L1 = [#item{value=rand:uniform(100)} | L],
  get_search_list(L1, N - 1).

compare(#item{value=Avalue}, #item{value=Bvalue}) when Avalue > Bvalue ->
  greater_than;
compare(#item{value=Avalue}, #item{value=Bvalue}) when Avalue =:= Bvalue ->
  equal_to;
compare(_, _) ->
  lower_than.

-spec search_test(atom(), fun((T, list(T)) -> list(T) | not_found)) -> ok.
search_test(Algorithm, F) ->
  % not found
  Expect1 = not_found,
  List1 = generate_test_value([1, 2, 3, 4, 5, 6]),
  SearchValue1 = #item{value=100},
  Result1 = F(SearchValue1, List1),
  show_search_test_result(Algorithm, "case 001 not found: ~w", Expect1, Result1),
  % empty list
  Expect2 = not_found,
  List2 = generate_test_value([]),
  SearchValue2 = #item{value=100},
  Result2 = F(SearchValue2, List2),
  show_search_test_result(Algorithm, "case 002 empty list: ~w", Expect2, Result2),
  % head hit
  Expect3 = #item{value=100},
  List3 = generate_test_value([100, 101, 102, 103, 104]),
  SearchValue3 = #item{value=100},
  Result3 = F(SearchValue3, List3),
  show_search_test_result(Algorithm, "case 003 head hit: ~w", Expect3, Result3),
  % tail hit
  Expect4 = #item{value=104},
  List4 = generate_test_value([100, 101, 102, 104, 104]),
  SearchValue4 = #item{value=104},
  Result4 = F(SearchValue4, List4),
  show_search_test_result(Algorithm, "case 004 tail hit: ~w", Expect4, Result4),
  % search 10000
  Expect5 = #item{value=32761},
  List5 = generate_test_value(get_10000_list()),
  SearchValue5 = #item{value=32761},
  Result5 = F(SearchValue5, List5),
  show_search_test_result(Algorithm, "case 005 10000 data: ~w", Expect5, Result5),
  % search 10000 not found
  Expect6 = not_found,
  List6 = generate_test_value(get_10000_list()),
  SearchValue6 = #item{value=32762},
  Result6 = F(SearchValue6, List6),
  show_search_test_result(Algorithm, "case 006 10000 data not found: ~w", Expect6, Result6),
  ok.    

show_search_test_result(Algorithm, Title, Expect, Result) ->
  case Result of
    Expect ->
      output_info(Algorithm, Title, [true]);
    _ ->
      output_info(Algorithm, Title, [false]),
      output_info(Algorithm, "Expect: ~w, Result: ~w", [Expect, Result])
  end.

output_debug(Module, S) ->
  case ?LOG_LEVEL =< 1 of
    true -> 
      io:fwrite("[DEBUG] " ++ Module ++ ": " ++ S ++ "~n");
    false ->
      io:fwrite("")
  end.
output_debug(Module, S, Args) when is_atom(Module) ->
  output_debug(atom_to_list(Module), S, Args);
output_debug(Module, S, Args) ->
  case ?LOG_LEVEL =< 1 of
    true -> 
      io:fwrite("[DEBUG] " ++ Module ++ ": " ++ S ++ "~n", Args);
    false ->
      io:fwrite("")
  end.

output_info(Module, S) ->
  case ?LOG_LEVEL =< 2 of
    true -> 
      io:fwrite("[INFO] " ++ Module ++ ": " ++ S ++ "~n");
    false ->
      io:fwrite("")
  end.
output_info(Module, S, Args) when is_atom(Module) ->
  output_info(atom_to_list(Module), S, Args);
output_info(Module, S, Args) ->
  case ?LOG_LEVEL =< 2 of
    true -> 
      io:fwrite("[INFO] " ++ Module ++ ": " ++ S ++ "~n", Args);
    false ->
      io:fwrite("")
  end.

